import React from 'react';

const DEFAULT_STATE = {
    user: {
        firstImg: [],
        name: '',
        distance: '',
    }
}

class Card extends React.Component {

    constructor(props){
        super(props);
        const user = this.props.user;
    }

    render() {
        return (
            <div className="CardContainer">
                <span>{this.user.firstname}</span>
            </div>
        )
    }
}

export default Card;
